import { Container, Row } from 'react-bootstrap';
import "./LandingPage.css";

const LandingPage = () => {
  return (
    <div className="main">
        <Container>
            <Row>LandingPage</Row>
        </Container>
    </div>
  );
};

export default LandingPage;
